import React from "react";
// import logo from "./logo.svg";
import "./App.css";
// import { BrowserRouter, Switch, Route } from "react-router-dom";
import login from "./Pages/login";
import { Switch, BrowseRouter, Route } from "@material-ui/core";

function App() {
  return (
    <BrowseRouter>
      <Switch>
        <Route exact path="/login" component={login} />
      </Switch>
    </BrowseRouter>

    // <BrowserRouter>
    //   <Switch>
    //     <Route exact path="/login" component={login} />
    //   </Switch>
    // </BrowserRouter>
  );
}

export default App;
